member.returns:
One, if the write was successful, otherwise;
zero if the stream was closed before the object could be written,
or if the object was AutomationNull.Value.

member.summary:
Looks up a localized string similar to Cannot append CSV content to the following file: {1}. The appended object does not have a property that corresponds to the following column: {0}. To continue with mismatched properties, add the -Force parameter, and then retry the command. {0} is a placeholder for property name (i.e. ProcessId) {1} is a placeholder for filename (i.e. c:\users\lukasza\foo.csv)
{StrContains="Force"}
Reviewed by TArcher on 2010-06-29.
